import React from "react";
import "./NewPlace.css";
import Input from "../../shared/components/FormElements/Input";
import {} from '../../shared/util/validators';

const NewPlace = () => {
  return (
    <form className="place-form">
      <Input
        element="input"
        type="text"
        label="Title"
        validators={[]}
        errorText="Please enter a valid title"
      />
    </form>
  );
};

export default NewPlace;
